/* FOOTER - JS */

import React from 'react';
import { Link } from 'react-router-dom';
import './style.css'

export default function Footer() {
    return(
        <footer className="footer">
            <Link to="contact"><p className="footer-contact-text">Presented by <span></span>Sophie BAYRAM</p></Link>
        </footer>
    )
}
